import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'host';
}
<div class="toolbar">
  <img
    width="40"
    alt="Angular Logo"
    src="data:image/svg+xml;base64,"
  />
  <span>Host</span>
</div>
<div class="custom">
  <app-remote-button-link name="Raiffeisen" url="https://raiffeisen.ch"/>
</div>
